import React from "react";

const Item = (props) => {
  return (
    <tr>
      <td>{props.name}</td>
      <td>{props.category}</td>
      <td>{props.amount}</td>
      <td>{props.date}</td>
      <td>
        <button onClick={props.delete}>Delete</button>
      </td>
    </tr>
  );
};

export default Item;
